import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import CreatePackage from './CreatePackage';
import ViewMyPackages from './ViewMyPackages';
import ViewUnassignedPackages from './ViewUnassignedPackages';
import AssignPackage from './AssignPackage';
import DeliverPackage from './DeliverPackage';
import UpdatePackage from './UpdatePackage';

const App = () => {
  // Example courierId, replace with actual dynamic data
  const courierId = 1;

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/create-package">Create Package</Link>
            </li>
            <li>
              <Link to={`/view-my-packages/${courierId}`}>View My Packages</Link>
            </li>
            <li>
              <Link to="/view-unassigned-packages">View Unassigned Packages</Link>
            </li>
            <li>
              <Link to="/assign-package">Assign Package</Link>
            </li>
            <li>
              <Link to="/deliver-package">Deliver Package</Link>
            </li>
            <li>
              <Link to="/update-package/1">Update Package</Link> {/* Replace 1 with actual package ID */}
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/create-package" element={<CreatePackage />} />
          <Route path="/view-my-packages/:courierId" element={<ViewMyPackages />} />
          <Route path="/view-unassigned-packages" element={<ViewUnassignedPackages />} />
          <Route path="/assign-package" element={<AssignPackage />} />
          <Route path="/deliver-package" element={<DeliverPackage />} />
          <Route path="/update-package/:packageId" element={<UpdatePackage />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
